import Header from './components/Header.jsx'
import Gamepage from './components/Gamepage.jsx'

import {io} from 'socket.io-client'

const socket = io()

socket.on('connect', () => {
  console.log(socket.id)
})

function App() {
  return (
    <div className='App'>
      <Header/>
      <Gamepage socket={socket}/>
    </div>
  )
}

export default App
